import css from './TikTokLikesPage.module.css';

export default function TikTokLikes({ data, index, toggleLikes }) {
  const { quantity, percent, price, oldPrice, savings, active } = data;

  return (
    <div
      className={`${css.data} ${active ? css.open : ''}`}
      onClick={() => toggleLikes(index)}
    >
      <div className={css.buyLikesQuantity}>
        <div className={css.quantity}>{quantity}</div>
        <div className={css.discount}>{percent}</div>
      </div>

      <div className={css.priceBlock}>
        <div div className={css.mainPrice}>
          {price}
        </div>
        <div className={css.oldPrice}>{oldPrice}</div>
        <div className={css.savings}>{savings}</div>
      </div>
    </div>
  );
}
